#
# TABLE STRUCTURE FOR: back_order
#

DROP TABLE IF EXISTS `back_order`;

CREATE TABLE `back_order` (
  `bo_id` int(11) NOT NULL AUTO_INCREMENT,
  `back_order_no` int(11) NOT NULL,
  `bo_product_name` varchar(50) NOT NULL,
  `bo_total_quantity` int(10) NOT NULL,
  `bo_unit` varchar(50) NOT NULL,
  `bo_received_quantity` int(10) NOT NULL,
  `bo_product_unitprice` decimal(10,2) NOT NULL,
  `bo_expiry_date` varchar(50) NOT NULL,
  PRIMARY KEY (`bo_id`),
  KEY `back_order_fk_4` (`back_order_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: back_order_no
#

DROP TABLE IF EXISTS `back_order_no`;

CREATE TABLE `back_order_no` (
  `back_order_id` int(11) NOT NULL AUTO_INCREMENT,
  `back_order_no` varchar(50) NOT NULL,
  `purchase_order_id` int(11) NOT NULL,
  `supplier_id` int(11) NOT NULL,
  `bo_total_cost` decimal(10,2) NOT NULL,
  `bo_date_received` varchar(50) NOT NULL,
  `isCancel` varchar(50) NOT NULL DEFAULT 'no',
  `status` varchar(50) NOT NULL DEFAULT 'received',
  PRIMARY KEY (`back_order_id`),
  KEY `back_order_fk_1` (`purchase_order_id`),
  KEY `back_order_fk_2` (`supplier_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: barcode
#

DROP TABLE IF EXISTS `barcode`;

CREATE TABLE `barcode` (
  `barcode_id` int(10) NOT NULL AUTO_INCREMENT,
  `unit` varchar(50) NOT NULL,
  `product_id` int(10) NOT NULL,
  `product_name` varchar(50) NOT NULL,
  `barcode` varchar(50) NOT NULL,
  `net_product_cost` int(10) NOT NULL,
  PRIMARY KEY (`barcode_id`),
  KEY `product_id` (`product_name`),
  KEY `product_id_2` (`product_id`),
  KEY `unit_id` (`unit`),
  CONSTRAINT `barcode_ibfk_1` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: branch
#

DROP TABLE IF EXISTS `branch`;

CREATE TABLE `branch` (
  `branch_id` int(10) NOT NULL AUTO_INCREMENT,
  `branch` varchar(50) NOT NULL,
  `isCancel` varchar(50) NOT NULL DEFAULT 'no',
  PRIMARY KEY (`branch_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: customer
#

DROP TABLE IF EXISTS `customer`;

CREATE TABLE `customer` (
  `customer_id` int(10) NOT NULL AUTO_INCREMENT,
  `account_no` varchar(50) NOT NULL,
  `customer_fname` varchar(50) NOT NULL,
  `customer_lname` varchar(50) DEFAULT NULL,
  `contact_no` bigint(12) NOT NULL,
  `balance` double NOT NULL,
  PRIMARY KEY (`customer_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: goods_received
#

DROP TABLE IF EXISTS `goods_received`;

CREATE TABLE `goods_received` (
  `goods_received_id` int(50) NOT NULL AUTO_INCREMENT,
  `goods_received_no` int(11) NOT NULL,
  `gr_product_name` varchar(150) NOT NULL,
  `gr_total_quantity` int(150) NOT NULL,
  `gr_unit` varchar(150) NOT NULL,
  `gr_received_quantity` int(150) NOT NULL,
  `gr_unserved_quantity` int(50) NOT NULL,
  `gr_expiry_date` date DEFAULT NULL,
  `gr_product_unitprice` decimal(10,2) NOT NULL,
  PRIMARY KEY (`goods_received_id`),
  KEY `goods_received_fk1` (`goods_received_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: goods_received_no
#

DROP TABLE IF EXISTS `goods_received_no`;

CREATE TABLE `goods_received_no` (
  `goods_received_no_id` int(11) NOT NULL AUTO_INCREMENT,
  `purchase_order_no_id` int(10) NOT NULL,
  `goods_received_no` varchar(150) NOT NULL,
  `supplier_id` int(50) NOT NULL,
  `date_received` varchar(150) NOT NULL,
  `gr_total_cost` decimal(10,2) NOT NULL,
  `isCancel` varchar(50) NOT NULL DEFAULT 'no',
  `status` varchar(50) NOT NULL DEFAULT 'received',
  PRIMARY KEY (`goods_received_no_id`),
  KEY `goods_received_no_fk2` (`supplier_id`),
  KEY `goods_received_no_fk1` (`purchase_order_no_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: goods_return
#

DROP TABLE IF EXISTS `goods_return`;

CREATE TABLE `goods_return` (
  `goods_return_id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_return_no` int(15) NOT NULL,
  `grt_product_name` varchar(150) NOT NULL,
  `grt_total_quantity` int(15) NOT NULL,
  `grt_unit` varchar(150) NOT NULL,
  `grt_returned_quantity` int(150) NOT NULL,
  `grt_price` int(150) NOT NULL,
  `grt_exp_date` date NOT NULL,
  PRIMARY KEY (`goods_return_id`),
  KEY `goods_return_fk3` (`goods_return_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: goods_return_no
#

DROP TABLE IF EXISTS `goods_return_no`;

CREATE TABLE `goods_return_no` (
  `goods_return_no_id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_return_no` varchar(150) NOT NULL,
  `goods_received_no` int(11) NOT NULL,
  `purchase_order_no` varchar(50) NOT NULL,
  `supplier_id` int(11) NOT NULL,
  `date_returned` varchar(150) NOT NULL,
  `grt_total_cost` decimal(10,2) NOT NULL,
  `isCancel` varchar(150) NOT NULL DEFAULT 'no',
  PRIMARY KEY (`goods_return_no_id`),
  KEY `goods_return_fk1` (`supplier_id`),
  KEY `goods_return_fk2` (`goods_received_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: inventory_adjustment
#

DROP TABLE IF EXISTS `inventory_adjustment`;

CREATE TABLE `inventory_adjustment` (
  `inventory_adjustment_id` int(10) NOT NULL AUTO_INCREMENT,
  `product_name` varchar(150) NOT NULL,
  `old_quantity` int(10) NOT NULL,
  `new_quantity` int(10) NOT NULL,
  `date_adjusted` varchar(150) NOT NULL,
  `reason` varchar(150) NOT NULL,
  PRIMARY KEY (`inventory_adjustment_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: inventory_ledger
#

DROP TABLE IF EXISTS `inventory_ledger`;

CREATE TABLE `inventory_ledger` (
  `ledger_id` int(11) NOT NULL AUTO_INCREMENT,
  `product_name` varchar(150) NOT NULL,
  `unit` varchar(150) NOT NULL,
  `quantity` int(10) NOT NULL,
  `price` decimal(10,2) NOT NULL,
  `activity` varchar(150) NOT NULL,
  `date_posted` varchar(150) NOT NULL,
  PRIMARY KEY (`ledger_id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: order
#

DROP TABLE IF EXISTS `order`;

CREATE TABLE `order` (
  `order_id` int(10) NOT NULL AUTO_INCREMENT,
  `order_no` varchar(15) NOT NULL,
  `customer_id` int(10) NOT NULL,
  `product_id` int(10) NOT NULL,
  `weight` float NOT NULL,
  `price` float NOT NULL,
  `total_amount` float NOT NULL,
  `payment_method` varchar(50) NOT NULL,
  `date_time` datetime(6) NOT NULL,
  PRIMARY KEY (`order_id`),
  KEY `customer_id` (`customer_id`),
  KEY `product_id` (`product_id`),
  CONSTRAINT `order_ibfk_1` FOREIGN KEY (`customer_id`) REFERENCES `customer` (`customer_id`),
  CONSTRAINT `order_ibfk_2` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: product
#

DROP TABLE IF EXISTS `product`;

CREATE TABLE `product` (
  `product_id` int(10) NOT NULL AUTO_INCREMENT,
  `product_code` varchar(50) NOT NULL,
  `product_name` varchar(50) NOT NULL,
  `product_brand` varchar(50) NOT NULL,
  `product_image` varchar(50) NOT NULL,
  `isDelete` varchar(20) NOT NULL DEFAULT 'no',
  `product_barcode` varchar(50) NOT NULL,
  `product_uom` varchar(50) NOT NULL,
  `product_category` varchar(50) NOT NULL,
  `product_quantity` float NOT NULL,
  `product_minimum_quantity` float NOT NULL,
  `product_price` decimal(10,2) NOT NULL,
  `product_dateadded` date NOT NULL,
  `date_updated` timestamp(6) NOT NULL DEFAULT current_timestamp(6) ON UPDATE current_timestamp(6),
  PRIMARY KEY (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: product_category
#

DROP TABLE IF EXISTS `product_category`;

CREATE TABLE `product_category` (
  `procat_id` int(11) NOT NULL AUTO_INCREMENT,
  `product_category` varchar(50) NOT NULL,
  `isCancel` varchar(50) NOT NULL DEFAULT 'no',
  PRIMARY KEY (`procat_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: product_orig
#

DROP TABLE IF EXISTS `product_orig`;

CREATE TABLE `product_orig` (
  `product_id` int(10) NOT NULL AUTO_INCREMENT,
  `Procedure` varchar(10) DEFAULT NULL,
  `product_name` varchar(100) DEFAULT NULL,
  `product_code` varchar(8) DEFAULT NULL,
  `product_price` decimal(10,2) DEFAULT NULL,
  `product_quantity` varchar(6) DEFAULT NULL,
  `Stock Level` decimal(8,3) DEFAULT NULL,
  `Reserved Stock` varchar(1) DEFAULT NULL,
  `product_category` varchar(50) DEFAULT NULL,
  `Subcategory` varchar(10) DEFAULT NULL,
  `product_uom` varchar(50) DEFAULT NULL,
  `Main Supplier` varchar(20) DEFAULT NULL,
  `Ref. Code` varchar(10) DEFAULT NULL,
  `product_brand` varchar(50) DEFAULT NULL,
  `product_minimum_quantity` int(10) DEFAULT NULL,
  `Max. Stock` varchar(1) DEFAULT NULL,
  `Below minimum` varchar(3) DEFAULT NULL,
  `Replace` varchar(10) DEFAULT NULL,
  `Reward?` varchar(2) DEFAULT NULL,
  `Points needed` int(1) DEFAULT NULL,
  `Taxation` varchar(10) DEFAULT NULL,
  `Net Weight` varchar(10) DEFAULT NULL,
  `Gross Weight` varchar(10) DEFAULT NULL,
  `Included in` varchar(22) DEFAULT NULL,
  `Changed in` varchar(22) DEFAULT NULL,
  `Changed by` varchar(5) DEFAULT NULL,
  `Comission` varchar(10) DEFAULT NULL,
  `Location` varchar(15) DEFAULT NULL,
  `Promotional` varchar(2) DEFAULT NULL,
  `Initial Date` varchar(10) DEFAULT NULL,
  `Final Date` varchar(10) DEFAULT NULL,
  `Promotional Price` varchar(10) DEFAULT NULL,
  `isDelete` varchar(6) NOT NULL DEFAULT 'no',
  `Tax %` varchar(10) DEFAULT NULL,
  `Bundle` varchar(2) DEFAULT NULL,
  `product_barcode` bigint(13) DEFAULT NULL,
  `Export to scale` varchar(2) DEFAULT NULL,
  PRIMARY KEY (`product_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3797 DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;



#
# TABLE STRUCTURE FOR: purchase_order
#

DROP TABLE IF EXISTS `purchase_order`;

CREATE TABLE `purchase_order` (
  `purchase_order_id` int(11) NOT NULL AUTO_INCREMENT,
  `purchase_order_no` int(11) NOT NULL,
  `product_name` varchar(50) NOT NULL,
  `po_product_quantity` int(11) NOT NULL,
  `product_unit` varchar(50) NOT NULL,
  `product_unitprice` decimal(10,2) NOT NULL,
  `vat_type` varchar(50) NOT NULL,
  `vat_amount` int(10) NOT NULL,
  `net_product_cost` double NOT NULL,
  PRIMARY KEY (`purchase_order_id`),
  KEY `purchase_order_fk1` (`purchase_order_no`),
  KEY `product_unit_id` (`product_unit`),
  CONSTRAINT `purchase_order_ibfk_1` FOREIGN KEY (`purchase_order_no`) REFERENCES `purchase_order_no` (`purchase_order_no_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: purchase_order_no
#

DROP TABLE IF EXISTS `purchase_order_no`;

CREATE TABLE `purchase_order_no` (
  `purchase_order_no_id` int(11) NOT NULL AUTO_INCREMENT,
  `purchase_order_no` varchar(50) NOT NULL,
  `supplier_id` int(11) NOT NULL,
  `date_created` varchar(50) NOT NULL,
  `payment_method` varchar(50) NOT NULL,
  `total_cost` decimal(10,2) NOT NULL,
  `is_delete` varchar(50) NOT NULL DEFAULT 'no',
  `status` varchar(50) NOT NULL DEFAULT 'pending',
  PRIMARY KEY (`purchase_order_no_id`),
  KEY `purchase_order_no_fk1` (`supplier_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: receiving
#

DROP TABLE IF EXISTS `receiving`;

CREATE TABLE `receiving` (
  `receiving_id` int(10) NOT NULL AUTO_INCREMENT,
  `receiving_no` varchar(50) NOT NULL,
  `product_code` varchar(50) NOT NULL,
  `product_name` varchar(50) NOT NULL,
  `supplier` varchar(50) NOT NULL,
  `product_uom` varchar(50) NOT NULL,
  `inbound_quantity` int(10) NOT NULL,
  `date` datetime(6) NOT NULL,
  `username` varchar(50) NOT NULL,
  `comments` varchar(100) NOT NULL,
  `product_image` varchar(50) NOT NULL,
  PRIMARY KEY (`receiving_id`)
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: sales
#

DROP TABLE IF EXISTS `sales`;

CREATE TABLE `sales` (
  `sales_id` int(11) NOT NULL AUTO_INCREMENT,
  `reference_no` int(11) NOT NULL,
  `product_name` varchar(50) NOT NULL,
  `quantity` int(11) NOT NULL,
  `product_price` int(11) NOT NULL,
  PRIMARY KEY (`sales_id`),
  KEY `sales_fk1` (`reference_no`),
  CONSTRAINT `sales_fk1` FOREIGN KEY (`reference_no`) REFERENCES `sales_no` (`sales_no_id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: sales_no
#

DROP TABLE IF EXISTS `sales_no`;

CREATE TABLE `sales_no` (
  `sales_no_id` int(11) NOT NULL AUTO_INCREMENT,
  `reference_no` varchar(50) NOT NULL,
  `date_created` varchar(50) NOT NULL,
  `payment_method` varchar(50) NOT NULL,
  `total_cost` decimal(10,2) NOT NULL,
  `customer_name` varchar(50) NOT NULL,
  PRIMARY KEY (`sales_no_id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: sales_return
#

DROP TABLE IF EXISTS `sales_return`;

CREATE TABLE `sales_return` (
  `sr_id` int(10) NOT NULL AUTO_INCREMENT,
  `sales_return_no` int(10) NOT NULL,
  `product_name` varchar(150) NOT NULL,
  `quantity` int(150) NOT NULL,
  `returned_quantity` int(150) NOT NULL,
  `unit` varchar(150) NOT NULL,
  `product_sellingprice` int(11) NOT NULL,
  `reason` varchar(150) NOT NULL,
  PRIMARY KEY (`sr_id`),
  KEY `sales_return_fk2` (`sales_return_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: sales_return_no
#

DROP TABLE IF EXISTS `sales_return_no`;

CREATE TABLE `sales_return_no` (
  `sales_return_id` int(10) NOT NULL AUTO_INCREMENT,
  `reference_no` int(10) NOT NULL,
  `date_created` varchar(150) NOT NULL,
  `date_returned` varchar(150) NOT NULL,
  `return_prepared_by` varchar(150) NOT NULL,
  `sr_total_cost` decimal(10,2) NOT NULL,
  `isCancel` varchar(150) NOT NULL DEFAULT 'no',
  PRIMARY KEY (`sales_return_id`),
  KEY `sales_return_fk1` (`reference_no`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

#
# TABLE STRUCTURE FOR: stock_requisition
#

DROP TABLE IF EXISTS `stock_requisition`;

CREATE TABLE `stock_requisition` (
  `sr_id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_requisition_no` int(15) NOT NULL,
  `product_name` varchar(150) NOT NULL,
  `quantity` int(15) NOT NULL,
  `unit` varchar(150) NOT NULL,
  `product_sellingprice` decimal(10,2) NOT NULL,
  PRIMARY KEY (`sr_id`),
  KEY `stock_requisition_no` (`stock_requisition_no`),
  CONSTRAINT `stock_requisition_ibfk_1` FOREIGN KEY (`stock_requisition_no`) REFERENCES `stock_requisition_no` (`stock_requisition_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: stock_requisition_admin
#

DROP TABLE IF EXISTS `stock_requisition_admin`;

CREATE TABLE `stock_requisition_admin` (
  `sra_id` int(11) NOT NULL,
  `stock_requisition_no` int(10) NOT NULL,
  `product_name` varchar(150) NOT NULL,
  `quantity` int(15) NOT NULL,
  `unit` varchar(150) NOT NULL,
  `product_sellingprice` decimal(10,2) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: stock_requisition_admin_no
#

DROP TABLE IF EXISTS `stock_requisition_admin_no`;

CREATE TABLE `stock_requisition_admin_no` (
  `stock_requisition_admin_id` int(11) NOT NULL,
  `stock_requisition_no` varchar(150) NOT NULL,
  `date_created` varchar(150) NOT NULL,
  `date_posted` varchar(150) NOT NULL,
  `total_cost` varchar(150) NOT NULL,
  `branch` varchar(150) DEFAULT NULL,
  `isCancel` varchar(150) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: stock_requisition_no
#

DROP TABLE IF EXISTS `stock_requisition_no`;

CREATE TABLE `stock_requisition_no` (
  `stock_requisition_id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_requisition_no` varchar(150) NOT NULL,
  `date_created` varchar(150) NOT NULL,
  `total_cost` varchar(150) NOT NULL,
  `branch` varchar(150) DEFAULT NULL,
  `status` varchar(150) NOT NULL DEFAULT 'pending',
  `prepared_by` varchar(150) NOT NULL,
  `isCancel` varchar(150) NOT NULL DEFAULT 'no',
  PRIMARY KEY (`stock_requisition_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: suppliers
#

DROP TABLE IF EXISTS `suppliers`;

CREATE TABLE `suppliers` (
  `supplier_id` int(150) NOT NULL AUTO_INCREMENT,
  `supplier_name` varchar(150) DEFAULT NULL,
  `company_name` varchar(150) DEFAULT NULL,
  `supplier_contact` varchar(11) DEFAULT NULL,
  `supplier_email` varchar(50) DEFAULT NULL,
  `supplier_street` varchar(150) DEFAULT NULL,
  `supplier_barangay` varchar(150) DEFAULT NULL,
  `supplier_city` varchar(150) DEFAULT NULL,
  `supplier_province` varchar(150) DEFAULT NULL,
  `status_supplier` varchar(50) NOT NULL DEFAULT 'active',
  `isDelete` varchar(10) NOT NULL DEFAULT 'no',
  PRIMARY KEY (`supplier_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: unit
#

DROP TABLE IF EXISTS `unit`;

CREATE TABLE `unit` (
  `unit_id` int(10) NOT NULL AUTO_INCREMENT,
  `unit` varchar(50) NOT NULL,
  `isCancel` varchar(60) NOT NULL DEFAULT 'no',
  PRIMARY KEY (`unit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



#
# TABLE STRUCTURE FOR: user
#

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `user_id` int(10) NOT NULL AUTO_INCREMENT,
  `first_name` varchar(50) NOT NULL,
  `last_name` varchar(50) NOT NULL,
  `username` varchar(50) NOT NULL,
  `password` varchar(50) NOT NULL,
  `role` varchar(50) NOT NULL,
  `warehouse` varchar(50) NOT NULL,
  `status` varchar(11) NOT NULL DEFAULT 'active',
  `isDelete` varchar(50) NOT NULL DEFAULT 'no',
  PRIMARY KEY (`user_id`),
  KEY `branch` (`warehouse`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;



